The world's most famous secret agent is back!

The legendary James Bond adventure returns with new gameplay modes and increased multiplayer options.

Additional to the legendary story campaign, the game introduces the brand new 'Mi6 Ops Missions' - new, distinct levels separate from the campaign that span the varied environments from the story and challenge players to complete different Assault, Elimination, Stealth and Defense objectives. 007: GoldenEye - Reloaded also takes multiplayer to new heights, maintaining and improving its renowned four-player split-screen action and adding full, adrenaline-pumping 16-player online matches with more maps, weapons, characters and game modes than ever before.

THIS IS A SCENE RELEASE, ALL CREDIT GOES TO THE ORIGINAL RIPPER!!!
